import React from 'react'
import { useSelector } from 'react-redux'

export default function Main() {

  const {state} = useSelector(state=>state);
  //console.log(state);
  return (
    <div>
      {state.todo &&
        state.todo.map((ele, idx) => (
          <div>
            <h1>ele.name</h1>
            <h1>ele.email</h1>
            <h1>ele.city</h1>
            <h1>ele.name</h1>
          </div>
        ))}
    </div>
  );
}
